function About(){
    return(
        <main>
            <div style={{display:"flex", justifyContent:"center", alignItems:"center"}}>
                <img src={about} style={{borderRadius:20}}/>
                <div style={{width:1240, height:223, backgroundColor:"black", borderRadius:20, position:"absolute", opacity:0.3}}></div>
                <span style={{color:"white", display:"flex", fontWeight:"bold", fontSize:35, position:"absolute"}}>Chez vous, partout et ailleurs</span>
            </div>
        </main>
    )
}

export default About
